postProcessingScript.body:
var exit = properties.get('exitCode');

scanner.register("NEWCOPY", function(lineNumber, line) {
     scanner.addLOI(lineNumber);
});

scanner.scan();

if (exit == 0) {
    properties.put('Status', 'Success');
}
else {
     properties.put('Status', 'Failure');
}

var exit = properties.get('exitCode');
//instancate empty strings to add members to
var existingMembers="";
var newMembers="";

scanner.register("Resource", function(lineNumber, line) {
    //output log info on members found in step output
     commandOut.print("Line number: "+lineNumber+"\n");
     commandOut.print("Line: "+line+"\n");
     //find member name between double quotes
     var firstQuoteIndex = line.indexOf("\"");
     var secondQuoteIndex = line.indexOf("\"", firstQuoteIndex+1);
     var member=line.substring(firstQuoteIndex+1, secondQuoteIndex);
     //output found memeber
     commandOut.print("member: "+member+"\n");

     //if member is enabled, add to existig member list, else add to new member ist
     if(line.indexOf("ENABLED")!=-1){
         existingMembers+=member+",";
         commandOut.print(member+" is not new.");
     }else{
         newMembers+=member+",";
         commandOut.print(member+" is new.");
     }
     commandOut.print("\n");
});
scanner.scan();
//add member lists to output properties.
properties.put("existingMembers", existingMembers);
properties.put("newMembers", newMembers);

//defualt always have step succeed. 
properties.put('Status', 'Success');
